var log = function(){
    return (typeof GM_log == 'function' && GM_log.apply(this, arguments));
}
var loader = 'data:image/png;base64,';

$.extend($, {
    head: function(url, params, callback){
	return $.ajax({
	    async: true,
	    cache: true,
	    complete: callback,
	    type: 'HEAD',
	    url: url,
	    data: params
	});
    }
});
$.fn.extend({
    toggleLoader: function(){
	return this.each(function(){
	    var $this = $(this);
	    if ($this.is(':visible')){
		var $img = $('<img />').attr({
		    src: loader
		}).addClass('ajax-loader');
		$this.hide().after($img);
	    } else {
		$this.show().next('.ajax-loader').remove();	   
	    }
	});
    }
});

$(document).ready(function(){
    var $logo = $('#header_logo');
    $logo.css({
	background: 'none', 
	width: 205, 
	height: 15,
	'line-height': '15px',
	'vertical-align': 'middle',
	'padding-top': 8
    })
    .text($('img', $logo).attr('title'));
    
    var $watched_links = $('.forum_header_border td[align="center"] a.thread');
    $watched_links.click(function(e){
	e.preventDefault();
	var $this = $(this);
	$this.toggleLoader();
	$.head($this.attr('href'), {}, function(r, status){			
	    if (status == 'success'){				
		$this.closest('tr').remove();
	    }
	    $this.toggleLoader();
	});	
	return false;
    }).attr('title', $watched_links.eq(0).text().toLowerCase() );
	
	
    var $watched_all_links = $('.forum_header_border td.section_post_header a.header');
    $watched_all_links.click(function(e){
	e.preventDefault();
	var $this = $(this);
	var $next = $this.closest('tr').nextUntil('tr.table');
	var loaders = $this.add($next.find('td:nth-child(1) a')).toggleLoader();		
	$.head($this.attr('href'), {}, function(r, status){
	    if (status == 'success'){
		$next.each(function(){
		    var $element = $(this);
		    if ($element.attr('name') == 'hover'){
			$element.remove();					
		    } else {
			return false;
		    }
		});
	    }
	    loaders.toggleLoader();		
	});
    });
});